import React from "react";
import { NavLink } from "react-router-dom";


function AboutUs() {
    return(
<div> 
    <h1>Team 5 - About Us</h1>

    <NavLink to="/aboutJames">
            <button ><span><h3>James Giatpaiboon</h3></span></button>
          </NavLink>


</div>
    );
}
export default AboutUs;
